def _partially_consume_prefix(self, prefix, column):
    lines = []
    current_line = ""
    current_column = 0
    wait_for_nl = False
    for char in prefix:
        current_line += char
        if wait_for_nl:
            if char == '\n':
                if current_line.strip() and current_column < column:
                    res = ''.join(lines)
                    return res, prefix[len(res):]

                lines.append(current_line)
                current_line = ""
                current_column = 0
                wait_for_nl = False
        elif char == ' ':
            current_column += 1
        elif char == '\t':
            current_column += 1
        elif char == '\n':
            # Reset to 0 when encountering a newline
            current_column = 0
            wait_for_nl = False
        else:
            wait_for_nl = True

    # Ensure that the last line is added correctly
    lines.append(current_line)

    return ''.join(lines), current_line
